function isPermutationOfPalindrome(phrase) {
    let countOdd = 0;
    let countMap = new Map();
    for (var i = 0; i < phrase.length; i++) {
        let x = 1;
        if(countMap.has(phrase.charAt(i))) {
            x = countMap.get(phrase.charAt(i)) + 1;
        }
        countMap.set(phrase.charAt(i), x);
        if(x%2 == 1) {
            countOdd++;
        } else {
            countOdd--;
        }
    }
    return countOdd <= 1;
}
